import React, { Component } from 'react';




class Home extends Component {
    render() {
        const myStyle={
            backgroundImage: 
     "url('./movies.png')",
            height:'100vh',
            marginTop:'-70px',
            fontSize:'50px',
            backgroundSize: 'cover',
            backgroundRepeat: 'no-repeat',
        };
        return (
            <div >
               <div style={myStyle}>
        <h1> geeksforgeeks </h1>
      </div>
                
                
            </div>
        );
    }
}

export default Home;
